import React from "react";
import s from "./Wishlist.module.css";

const WishlistItem = (props) => {
  const state = props.shopPage.games;
  return (
    <div className={s.item}>
      <div>
        <img src={state}/>
      </div>
      <div></div>
      <div></div>
    </div>
  );
};

export default WishlistItem;
